import React from 'react'
import Img from "./CardData"
import Card from "./Card"


function Regards() {
    return (
        <div>
            {Img.map((val)=>{
                return (
                    <Card src = {val.src}
                        href={val.link}/>
                )
            })}
        </div>
    )
}

export default Regards
